import { Carousel } from 'antd';
import "./subs.css"
import c1 from "./images/crous1.jpg"
import c2 from "./images/crous2.jpg"
import c3 from "./images/crous3.jpg"
import c4 from "./images/crous4.jpg"

const contentStyle = {
  height: '460px',
  color: '#fff',
  lineHeight: '160px',
  textAlign: 'center',
  background: '#364d79',
};
const Subscription = () => {
 
  return (
    <div className='crous'>
     <Carousel autoplay>
    <div>
      <h3 style={contentStyle,c}><img src={c1} /></h3>
    </div>
    <div>
      <h3 style={contentStyle}><img src={c2} /></h3>
    </div>
    <div>
      <h3 style={contentStyle}><img src={c3} /></h3>
    </div>
    <div>
      <h3 style={contentStyle}><img src={c4} /></h3>
    </div>
  </Carousel>
    </div>
  );
};
export default Subscription;
